import './App.css';
import logo from './images/logo.svg';
import Header from './components/header/header';
import './components/header/header.css';

function App() {
  return (
    <div>
      <Header />
      <img src={logo} alt='MbrllaHacks'></img>
    </div>
  );
}

export default App;
